import { Component } from "react";

const styles = {
  detallesCarro: {
    backgroundColor: "#fff",
    position: "absolute",
    marginTop: 20,
    boxShadow: "1px 5px 5px rgb(0,0,0, 0.3)",
    borderRadius: "5px",
    width: '200px'
  },
};

class DetallesCarro extends Component {
  render() {
    return <div style={styles.detallesCarro}>lala</div>;
  }
}
export default DetallesCarro;
